import React from "react";
import {
  View,
  StyleSheet,
  Text,
  StatusBar,
} from "react-native";

const RepositoryItem = ({ id }) => {
  return (
    <View>
      <Text>{id}</Text>
    </View>
  );
};
export default RepositoryItem;
